import struct, sys

def create_procs_bin():
    for name in procnames.keys():
        if len(name) > 30:
            raise ValueError(f"Name '{name}' is too long (30 characters max)")
        
    procnames_values = list(procnames.values())
    for i in range(1, len(procnames_values)):  # Start from 1 to avoid checking the first element
        if procnames_values[i] - 1 != procnames_values[i - 1]:
            raise ValueError(f"Value {procnames_values[i]} at index {i} is not sequential with previous value {procnames_values[i - 1]}")
        
    if len(procnames) != 792:
        raise ValueError(f"Expected 792 procnames, but got {len(procnames)}")
        
    with open("procs.bin", "wb") as f:
        for name, value in procnames.items():
            # Write the ID as a 16-bit signed integer in big-endian format
            id_bytes = struct.pack('>h', value)

            # Write the name as a string, then pad with zeros
            name_bytes = name.encode('utf-8').ljust(30, b'\0')

            # Write the bytes to the file
            f.write(id_bytes)
            f.write(name_bytes)

        print("procs.bin created successfully.")
        
if __name__ == "__main__":
    create_procs_bin()